function compareNumbers(a, b) {
  return a - b;
}

//     
function CookieList(name,id,command,sort)
{
//del - add
//alert($.cookie(name));
var cookie = $.cookie(name);
	//alert(cookie);
if(cookie==null) { $.cookie(name, id, {expires: 60,path: '/',domain: window.is_session,secure: false});
 } else
{
	if(command=='del')
	{
		
	var cc = cookie.split('.');
	var text='';
	var lp=0;
	for ( var t = 0; t < cc.length; t++ ) 
	{ 
	  if(cc[t]!=id)
	  {
		  if(cc[t]!='')
		  {	  
		    if(lp==0)
		    {
			  text=cc[t];
		    } else
		    {
			  text=text+'.'+cc[t];
		    }
		    lp++;
		  }
	  }
	}
	if(text=='')
	{
		$.cookie(name, null, {path:'/',domain: window.is_session,secure: false}); 
	} else
	{
	    $.cookie(name, text, {path: '/',domain: window.is_session,secure: false});  //60 
	}
	
	} else
	{
		//alert(sort);
		  if (sort === undefined) {
               $.cookie(name, cookie+'.'+id, {path: '/',domain: window.is_session,secure: false}); //60 
          } else
	      {
				  if(sort=='sort')
				  {
						var jon_cookie=cookie+'.'+id;
					    var jon_cc = jon_cookie.split('.'); 
					  
					   jon_cc= jon_cc.sort(compareNumbers);
					   //alert(jon_cc.join("."));
					   $.cookie(name, jon_cc.join("."), {path: '/',domain: window.is_session,secure: false}); //60 
					    
				  }
				  
		  }
		
		
		
	}
}
	//alert(cookie);
}



