		//var hf1=hf.split('_');
		//alert(hf1[0]);
		//UpdateStatusADA(hf1[0]);
		
		
		var iu=$('.content_block').attr('iu');
	
		$('[rel_score='+update+']').next().find('[rel=2]').parents('li').hide();
		$('[rel_score='+update+']').next().find('[rel=3]').parents('li').hide();
		$('[rel_score='+update+']').next().find('[rel=4]').parents('li').hide();
		
